import React from 'react';

const todo = (props) => {
    return ( 
        <div style={{
            textDecoration: props.todo.complete ?"line-through" : ""
        }}
        onClick={props.onComplete}>
            {props.todo.text}
        </div>

      );
}

export default todo;
